import { useState } from 'react'
import UserSidebar from '../components/UserSidebar'
import workoutServices from '../services/workouts'
import './WorkoutHistoryPage.css'

import maleHumanBodyImage from '../maleHumanBodyImage.png'
import maleHumanBodyMap from '../maleHumanBody.map'

const WorkoutHistoryPage = ({setLoggedIn}) => {

    const [openDropdown, setOpenDropdown] = useState(false)
    const [prevWorkouts, setPrevWorkouts] = useState([])
    const [selectedWorkout, setSelectedWorkout] = useState(null)

    const handleDropdownClick = () => {
	setOpenDropdown(!openDropdown)
	workoutServices.get().then(userWorkouts => {		
	    console.log(userWorkouts)
	    setPrevWorkouts(userWorkouts)
	})
	console.log(prevWorkouts)	    
    }

    const handleSelectedWorkoutChange = (event) => {
	console.log(`event ${event.target.value}`)
	setSelectedWorkout(prevWorkouts.at(event.target.value.toString()))
    }

    const Dropdown = ({open, trigger}) => {
	return (
	        <>
		    {trigger}
	            {open ? (
		    <ul>
			    <select name="previous-workouts" id="previous-workouts" value={selectedWorkout} onChange={handleSelectedWorkoutChange}>
			    {prevWorkouts.map((workout, index) =>
				    <option value={index}> {workout.createdAt} </option>)}
		        </select>
		    </ul>
	            ) : null}
	        </>
	    )
    }

    const HumanBody = () => {
	return (
		<div>
		<img src={maleHumanBodyImage} alt="Male Human Body" useMap="#bodyMap" />
		<map name="bodyMap" id="bodyMap">
		{maleHumanBodyMap}
	        </map>
		</div>
	)
    }

    return (<div className="wh-main">
	    <HumanBody />
	    <UserSidebar setLoggedIn={setLoggedIn}/>
	    <div className="prev-workouts">
	    <Dropdown
	        open={openDropdown}
	        trigger={<button onClick={handleDropdownClick}> Previous Workouts </button>}
	    />
	    {selectedWorkout === null ? <label> Choose a workout  </label> :
	     <ul>
	     <li className="labels">
	     <span className="label"> Exercise </span>
	     <span className="label"> Sets </span>
	     <span className="label"> Reps </span>
	     </li>
	     {selectedWorkout.clusters.map(cluster =>
		     <li className="labels">
		     <span className="label"> {cluster.exercise} </span>
		     <span className="label"> {cluster.sets} </span>
		     <span className="label"> {cluster.reps} </span>
		     </li>
	     )
	     }
	     </ul>
	     }
	    </div>
	    </div>
	   )
}

export default WorkoutHistoryPage
